import React from "react";

const Details = ({ data }) => {
  const Link = data[1];
  const tempArea = data[2];
  const tempPerimeter = data[3];
  const area = tempArea[0].toFixed(4);
  const perimeter = tempPerimeter[0].toFixed(4);
  return (
    <div className="container">
      <div className="bbox">
        <h4>API</h4>
        <a href={Link}>{Link}</a>
      </div>
    </div>
  );
};

export default Details;
